import React from "react";

const styles = {
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  justifyContent: "center",
};

function pokemonDetailed({ name, image }) {
  return (
    <div style={{ styles }}>
      <h2>{name}</h2>
      <img src={image} />
    </div>
  );
}

export default pokemonDetailed;
